import React from 'react'

export const Card = ({item}) => {
  return (
    <div className='my-8'>
        <a href="https://jay035.github.io/Calculator/">
          {/* <!-- screenshot --> */}
          <img src={item.image} alt="" />
        </a>
        <div class="info">
          <p class="">1. {item.title} </p>
          <p class="subInfo">A vanilla javascript based calculator web app that performs simple arithmetic operations.</p>
          
          <div class="links">
            {/* <!-- link to github repo --> */}
            <a href="https://github.com/Jay035/Calculator-app">
            </a>
            {/* <!-- link to live site  --> */}
            <a href="https://jay035.github.io/Calculator/">
            </a>
          </div>
        </div>
    </div>
  )
}
